import './App.css';
import { useEffect, useState } from 'react';
import { Routes, Route } from 'react-router'
import LoginPage from './pages/LoginPage';
import MoviePage from './pages/MoviePage';
import MainNavigation from './components/MainNavigation';
import SignupPage from './pages/SignupPage';
import classes from "./pages/LoginPage.module.css";
import card_classes from "./components/ui/css/Card.module.css"
import Card from "./components/ui/js/Card";



function App() {

  return (
    <div>
      <MainNavigation />

      <Routes>
        <Card stylecard={card_classes.logincard + " " + card_classes.centerform}>
          <div className={classes.login}>
            <Route path="/" element={<LoginPage />} />
            <Route path="/signup" element={<SignupPage />} />
          </div>
        </Card>
        <Route path="/movie" element={<MoviePage />} />
      </Routes>
    </div>
  );
}

export default App;
